import React from 'react';
import {NavLink} from 'react-router-dom';




function Navbar(){
  return (
    <div>
      <nav>
      <div class="logo"><img src="./logo2.png"  alt="logo" /></div>
        <div class="links">
          <button><NavLink  to='/' exact activeClassName="active">Strona Główna</NavLink></button>
          <button><NavLink  to='/onas' activeClassName="active">O nas</NavLink></button>
          <button><NavLink  to='/oferta' activeClassName="active">Oferta</NavLink></button>
          <button><NavLink  to='/przedszkole' activeClassName="active">Przedszkole</NavLink></button>
          <button><NavLink  to='/aktualnosci' activeClassName="active">Aktualności</NavLink></button>
          <button><NavLink  to='/rekrutacja' activeClassName="active">Rekrutacja</NavLink></button>
          <button><NavLink to='/kontakt' activeClassName="active">Kontakt</NavLink></button>
          
  
        </div>
        <div class="links-mobile"></div>
      </nav>
    </div>
  );
};
  
export default Navbar;
